// Doctorhome.js
import React from 'react';
import { Link } from 'react-router-dom';

const DoctorHome = () => {
  return (
    <div style={styles.container}>
      <h1 style={styles.title}>Welcome, Doctor!</h1>
      <p style={styles.subtitle}>You have access to your medical records and appointments.</p>
      <Link to="/appointments" style={styles.button}>
        <div style={styles.buttonContent}>Go to Appointments</div>
      </Link>
    </div>
  );
};

const styles = {
  container: {
    textAlign: 'center',
    padding: '50px',
    backgroundColor: '#87CEEB', // Light blue background color
  },
  title: {
    fontSize: '24px',
    color: '#333',
  },
  subtitle: {
    fontSize: '18px',
    color: '#555',
  },
  button: {
    display: 'inline-block',
    marginTop: '20px',
    padding: '10px',
    backgroundColor: '#4CAF50', // Green button color
    color: '#fff',
    textDecoration: 'none', // Remove default link styling
    cursor: 'pointer',
    borderRadius: '5px',
    transition: 'background-color 0.3s',
  },
  buttonContent: {
    fontSize: '16px',
  },
};

export default DoctorHome;
